class NGP
{

private $names = array();
private $rndname = array();

function __construct()
{
	$this -> loadnames();
}

/*
 * generate_name
 * @input culture: cultura
 * @input sex: sesso
 * @return $rndname vettore -> name = nome, surname = cognome
*/

function generate_name( $culture = null, $sex = null )
{

	if ( is_null( $culture ) or is_null ( $sex ) )
		die ("Fatal: culture and sex must be specified"); 
	
	$names = $this -> names[$culture][$sex]['Name'] ; 
	$surnames = $this -> names[$culture]['*']['Surname'] ; 
	
	$name = array_rand( $names );
	$surname = array_rand( $surnames );
	
	$this -> rndname['name'] = utf8_encode($names[$name]);
	$this -> rndname['surname'] = utf8_encode($surnames[$surname]);
	
	return $this -> rndname;
	
}

